$templateCache.put("docs/base-js/sections/base-helpers.section.html","<doc-section><doc-header id=\"base-helpers\">BaseHelpers</doc-header><p>BaseHelpers is an additional light-weight object with commonly used functions that is bundled with base-js. It is automatically included when base-js is loaded.</p><table class=\"table striped bordered\"><thead><th>Function</th><th>Purpose</th><th>Parameters</th></thead><tbody><tr><td>setCookie</td><td>Set value of a browser cookie.</td><td>(name, value, hours)</td></tr><tr><td>getCookie</td><td>Retrieve a value of a browser cookie.</td><td>(name)</td></tr><tr><td>inverseTables</td><td>Return an object with reversed key-values.</td><td>(key-value object)</td></tr><tr><td>getUrlParam</td><td>Retrieve value of URL parameter</td><td>(name)</td></tr><tr><td>formatDateElement</td><td>Format date property(hour, minute) to a two-digit #.</td><td>(value)</td></tr><tr><td>dateToString</td><td>Format date to mm-dd-yyyy</td><td>(milliseconds)</td></tr><tr><td>dateTimeToString</td><td>Format date to mm-dd-yyyy HH:MM</td><td>(milliseconds, timezone)</td></tr><tr><td>durationToString</td><td>Format duration value</td><td>(milliseconds, format)</td></tr><tr><td>timeOfDayToString</td><td>Format time of day value.</td><td>(milliseconds)</td></tr><tr><td>redirectToEditForm</td><td>Redirect to QuickBase table edit form.</td><td>(dbid, rid, root)</td></tr><tr><td>redirectToViewForm</td><td>Redirect to QuickBase table view form.</td><td>(dbid, rid, root)</td></tr><tr><td>downloadFile</td><td>Download QuickBase file attachment.</td><td>(dbid, rid, fid, version)</td></tr></tbody></table><doc-notice>BaseHelpers is bundled and automatically loaded with base-js. There is no additional requiring to access these functions.</doc-notice></doc-section>");
$templateCache.put("docs/base-js/sections/change-log.section.html","<doc-section><doc-header id=\"change-log\">Change Log</doc-header><p><b>base-js</b> uses semantic-versioning in the format of x.y.z(Major.Minor.Patch)</p><ul><li>x stands for a major version</li><li>y stands for a minor version</li><li>z stands for a patch</li></ul><p>Versions:</p><table class=\"table bordered striped\"><thead><th>Version</th><th>Description</th><th>Deployment Date</th></thead><tr><td>4.11.0</td><td>Added RunImport API function.</td><td>08/03/2016</td></tr><tr><td>4.10.0</td><td>Update .getTableFields() to return table meta data.</td><td>07/19/2016</td></tr><tr><td>4.9.1</td><td>Added functionality to retrieve table info.</td><td>07/14/2016</td></tr><tr><td>4.9.0</td><td>QuickBase API call error management.</td><td>07/01/2016</td></tr><tr><td>4.8.2</td><td>Local development proxy url updated.</td><td>06/01/2016</td></tr><tr><td>4.8.1</td><td>Return json errors.</td><td>05/01/2016</td></tr><tr><td>4.8.0</td><td>Added QuickStart portal functionality.</td><td>04/01/2016</td></tr></table><doc-notice><br>CDN:<br>https://s3.amazonaws.com/ais_libraries/BaseJS/x.x.x/base.min.js</doc-notice><doc-best-practice>Ensure to contribute any <b>base-js</b> changes to this documentation with the new version and a description of change.</doc-best-practice></doc-section>");
$templateCache.put("docs/base-js/sections/common-functions.section.html","<doc-section><doc-header id=\"common-functions\">Common Functions</doc-header><p>The majority of API calls in the QuickBase API are covered by base-js but some API calls are much more utilized than others. Below are the list of the most common functions:</p><doc-header id=\"do-query\" class=\"secondary\">doQuery</doc-header><doc-caption>Used to retrieve records from a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#do_query.html\" target=\"_blank\">API_DoQuery</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>query</td><td>object | array</td><td>Valid query filter</td><td>yes</td></tr><tr><td>options</td><td>object</td><td><a href=\"http://www.quickbase.com/api-guide/index.html#do_query.html#Request_Parameters\" target=\"_blank\">API</a></td><td>yes, if no options still use {}</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>records matched</td><td>array of objects</td><td>object\'s contains all table fields(key) and record values(value) set in configuration or clist</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //retrieve all primary toy records\n      db.toys.doQuery({ primary: \"1\" }, { slist: [6,9] }).then(function(toys){\n        /*\n          toys => [\n            { name: \"Buzz Lightyear\", description: \"Space-ranger action figure who wears a space suit.\" },\n            { name: \"Woody\", description: \"Cowbody doll, Andy\'s favorite.\" },\n            { name: \"Jesse\", description: \"Cowgirl doll and part of the Woody\'s Round Up gang.\" }\n          ]\n        */\n      });\n    </code>\n  </pre><doc-header id=\"add-record\" class=\"secondary\">addRecord</doc-header><doc-caption>Used to add a single record to a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#add_record.html\" target=\"_blank\">API_AddRecord</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>record</td><td>object</td><td>object of field-values</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>record id</td><td>int</td><td>auto-generated record id</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //add new toy record\n      let toy = { \n        name: \"Hamm\", \n        description: \"Wisecracking realist piggy bank.\", \n        voicedBy: \"John Ratzenberger\" \n      };\n\n      db.toys.addRecord(toy).then(function(newRecordId){\n        //newRecordId => 10001\n      });\n    </code>\n  </pre><doc-header id=\"delete-record\" class=\"secondary\">deleteRecord</doc-header><doc-caption>Used to delete a single record from a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#delete_record.html\" target=\"_blank\">API_DeleteRecord</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>record id</td><td>string | int</td><td>Existing record id</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th><th>Example</th></thead><tbody><tr><td>success or failure</td><td>boolean</td><td>true if record was successfully deleted, false if the record was not deleted.</td><td>10001</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //delete toy record\n      db.toys.delete(10001).then(function(deleted){\n        //deleted => true\n      });\n    </code>\n  </pre><doc-header id=\"import-from-csv\" class=\"secondary\">importFromCSV</doc-header><doc-caption>Used to add a collection of records to a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#import-from-csv.html\" target=\"_blank\">API_ImportFromCSV</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>array of records</td><td>array</td><td>objects of field-values</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>array of new records id\'s</td><td>array</td><td>record id\'s</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //import collection of toys\n      let toys = [\n        { name: \"Rex\", description: \"Excitable large, green, plastic Tyrannosaurus rex.\", voicedBy: \"Wallace Shawn\" },\n        { name: \"Slinky Dog\", description: \"Dachshund w/ slinky for body, speaks with a southern accent.\", voicedBy: \"Jim Varney\" },\n        { name: \"Mr. Potato Head\", description: \"Doll based on the real-life toy by Playskool.\", voicedBy: \"Don Rickles.\" },\n        { name: \"Bullseye\", description: \"Woody\'s horse that acts like a dog.\", voicedBy: \"\" },\n        { name: \"Bo Peep\", description: \"Porcelain figurine attached to Molly\'s bedside lamp.\", voicedBy: \"Annie Potts\" },\n      ];\n\n      db.toys.importFromCSV(toys).then(function(newRecordIds){\n        //newRecordIds => [10001, 10002, 10003, 10004, 10005]\n      }); \n    </code>\n  </pre><doc-best-practice>If adding a collection of records, use importFromCSV instead of addRecord. importFromCSV is way faster.</doc-best-practice></doc-section>");
$templateCache.put("docs/base-js/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\" nav-text=\"Deployment\">Deployment</doc-header><p><b>base-js</b> is hosted on Amazon S3. When deploying a new version, a new Amazon S3 folder and file will be generated and a new CDN url will be automatically generated.</p><p>To deploy a new version, run \"gulp deploy\". The \'./src/base.js\' version will be compiled and stored in \"./dist/x.y.z/base.min.js\" and automatically uploaded to Amazon S3.</p><doc-best-practice>Always deploy a new version no matter how small the patch. Ensure to update the quickstart section and the change log of the documentation to reflect the lastest version.</doc-best-practice><doc-warning>Deploying changes to an existing version will overwrite the existing Amazon S3 file.</doc-warning></doc-section>");
$templateCache.put("docs/base-js/sections/error-handling.section.html","<doc-section><doc-header id=\"error-handling\">Error Handling</doc-header><p>As of v4.9.0, all HTTP errors or QuickBase errors are returned.</p><p>Errors will bypass any callback functions and automatically return an error JSON object. A message description of the error will be included along with a error code. The error code will either reflect a network error code or the actual <a href=\"http://www.quickbase.com/api-guide/index.html#errorcodes.html\" target=\"_blank\">QuickBase error codes</a>.</p><h5>Examples</h5><pre>\n  	<code class=\"language-javascript\">\n  		{ error: { message: \"Something went wrong.\", code: \"500\" } }\n  		{ error: { message: \"Invalid input\", code: \"2\" } }\n  		{ error: { message: \"Missing required field\", code: \"50\" } }\n  	</code>\n  </pre><doc-warning>Please provide feedback on error handling as neccessary as this is a new as of v4.9.0 and may not meet all needs.</doc-warning></doc-section>");
$templateCache.put("docs/base-js/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><doc-caption><p><b>base-js</b> is a JavaScript library built for the QuickBase API.</p></doc-caption><p><b>base-js</b> includes functions for almost all <a href=\"http://www.quickbase.com/api-guide/index.html\" target=\"_blank\">QuickBase API calls</a>. It provides common helper functions, query selectors and finder methods. Everything is JSON instead of QuickBase\'s default XML. Promises and callbacks are both supported.</p></doc-section>");
$templateCache.put("docs/base-js/sections/querying.section.html","<doc-section><doc-header id=\"querying\">Querying</doc-header><p>To query records in a table, you must specify the conditions that determine which records to select for read, update, and delete operations by using query filters and comparison operators.</p><doc-header id=\"query-filters\" class=\"secondary\">Query Filters</doc-header><p>A query filter is an object that includes a single field-value condition or collections of conditions with corresponding query comparison operators. This isn\'t a new concept and was inspired by <a href=\"https://docs.mongodb.com/manual/tutorial/query-documents/\" target=\"_blank\">MongoDB</a> method of querying records.</p><p>{ field: value } or { field : { XEX: value } }</p><doc-notice>The field value in a query is the name you set in your original configuration object in your table fields. Never use field id\'s, it won\'t work and it is not good practice.</doc-notice><doc-header id=\"query-examples\" class=\"secondary\">Query Examples</doc-header><pre>\n    <code class=\"language-javascript\">\n      { name: \"Woody\" },\n      { description: { XEX: \"cowboy\" } },\n      { name: \"Woody\", voicedBy: \"Tom Hanks\" },\n      { or: [{ name: \"Woody\" }, { name: \"Buzz\" }] },\n      { or: [{ name: { XEX: \"Buzz\"} }, { voicedBy: \"Tom Hanks\" }] },\n      { or: [{ name: { CT: \"Buzz\"} }, { name: \"Hamm\" }, { voicedBy: { CT: \"Hanks\" } }] },\n      { name: \"Woody\", or: [{ voicedBy: \"Tim Allen\" }] },\n      { name: \"Woody\", or: [{ voicedBy: \"Tim Allen\" }], recordId: 10001 },\n      { name: { in: [\"Woody\", \"Buzz\"]}}\n    </code>\n  </pre><doc-header id=\"and-ors\" class=\"secondary\">And\'s, Or\'s</doc-header><p>To concatenate multiple query criterias together(AND\'s), simply add additional key-values to your query filter and they will automatically be combined.</p><pre>\n    <code class=\"language-javascript\">\n      { name: \"Woody\", voicedBy: \"Tom Hanks\" } will translate to \"{\'name\'.EX.\'Wooday\'}AND{\'voicedBy\'.EX.\'Tom Hanks\'}\"\n    </code>\n  </pre><p>To generate an or query:</p><ul><li>add an \'or\' key value and set the value an array of query filters</li><li>add a field name as the key and set the value as an object with \'in\' set as the key and an array of values as the value.</li></ul><pre>\n    <code class=\"language-javascript\">\n      { or: [{ name: \"Woody\" }, { name: \"Buzz\" }] } will translate to \"{\'name\'.EX.\'Wooday\'}OR{\'name\'.EX.\'Buzz\'}\"\n      { name: [\'Woody\', \'Buzz\'] } will translate to \"{\'name\'.EX.\'Woody\'}OR{\'name\'.EX.\'Buzz\'}\"\n    </code>\n  </pre><doc-header id=\"comparison-operators\" class=\"secondary\">Comparison Operators</doc-header><p>All <a href=\"https://www.quickbase.com/api-guide/index.html#do_query.html#queryOperators\" target=\"_blank\">QuickBase API query comparison operators</a> are allowed.</p><doc-notice>By default a simple { field : value } will be treated as an equals operator(\"EX\").</doc-notice><p>Common comparison operators include:</p><table class=\"table striped bordered\"><thead><th>Operator</th><th>Detail</th><th>Example</th></thead><tbody><tr><td>EX</td><td>is equal to value</td><td>{ name: \"Woody\" }</td></tr><tr><td>XEX</td><td>is not equal to value</td><td>{ name: { XEX: \"Buzz Lightyear\" } }</td></tr><tr><td>CT</td><td>contains value</td><td>{ name: { CT: \"Buzz\" } }</td></tr><tr><td>XCT</td><td>does not contain value</td><td>{ name: { XCT: \"Wood\" } }</td></tr><tr><td>OBF</td><td>on or before value</td><td>{ dateCreated: { OBF: \"01-01-2015\" } }</td></tr><tr><td>OAF</td><td>on or after value</td><td>{ dateCreated: { OAF: \"01-01-2015\" } }</td></tr><tr><td>LT</td><td>less than value</td><td>{ number_of_toys: { LT: 10 } }</td></tr><tr><td>GT</td><td>greater than value</td><td>{ number_of_toys: { GT: 12 } }</td></tr></tbody></table><doc-header id=\"query-helpers\" class=\"secondary\">Finder Methods</doc-header><p>Finder methods are used the same way as doQuery except they have a specialized purpose. Just need the first record, the last record or all records, use these quick hitters.</p><table class=\"table bordered striped\"><thead><th>Function</th><th>Purpose</th><th>Parameters</th><th>Response</th></thead><tbody><tr><td>doQueryCount</td><td>Find the number of records matching query filter</td><td>query</td><td>number of records(int)</td></tr><tr><td>find</td><td>retrieve a single record</td><td>record id</td><td>single record(object)</td></tr><tr><td>first</td><td>retrieve the first match</td><td>query, options</td><td>single record(object)</td></tr><tr><td>last</td><td>retrieve the last match</td><td>query, options</td><td>single record(object)</td></tr><tr><td>all</td><td>retrieve all records in table</td><td>options</td><td>records(array of objects)</td></tr><tr><td>getRids</td><td>retrieve any array of record id\'s</td><td>query</td><td>rids(array of record id\'s)</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/base-js/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><p>Utilizing base-js first requires a useable QuickBase application. Once you have an application, you will need to collect the database and table settings. base-js bootstraps these configurations to create a more-powerful, object-oriented client.</p><doc-header id=\"cdn\" class=\"secondary\">CDN</doc-header><p>The library is hosted and managed on <a href=\"https://github.com/AdvantageIntegratedSolutions/base-js\" target=\"_blank\">Github</a>. The CDN is hosted on Amazon S3. Include the below scripts in your project. jQuery is the only library dependency so be sure to also include jQuery in your project.</p><ul><li>https://s3.amazonaws.com/ais_libraries/BaseJS/x.x.x/base.min.js</li><li>https://ajax.googleapis.com/ajax/libs/jquery/2.2.4/jquery.min.js</li></ul><doc-notice><br>Latest Version:<br>https://s3.amazonaws.com/ais_libraries/BaseJS/4.11.0/base.min.js</doc-notice><doc-header id=\"initialize\" class=\"secondary\">Initialize</doc-header><p>Initializing is easy, yet powerful. A <b>base-js</b> client is initialized by taking a configuration object including all the <a href=\"#settings\">settings</a> and QuickBase database properties that allow you to develop faster with an object-oriented mindset and forget about tedious QuickBase configuration.</p><pre>\n    <code class=\"language-javascript\">\n      const db = new Base(configObject);\n    </code>\n  </pre><doc-header id=\"quick-examples\" class=\"secondary\">Quick Examples</doc-header><doc-caption>Let\'s move on to some quick examples of the most commonly used functions.</doc-caption><pre>\n    <code class=\"language-javascript\">\n      const config = {\n        apptoken: \"cgfsmfcdc5vyp5k5s7h6b6v3m9v\", //apptoken\n        async: \"promise\",\n        databaseId: \"bjbsgxy2r\", //main application dbid\n        tables: {\n          toys: {\n            dbid: \"bjbsgxy3t\", //table id\n            rid: 3, //field id\n            name: 6,\n            type: 8,\n            description: 9,\n            voicedBy: 10,\n            primary: 11\n          }\n        }\n      };\n\n      const db = new Base(config);\n\n      //retrieve all primary toy records\n      db.toys.doQuery({ primary: \"1\" }, { slist: [6,9] }).then(function(toys){\n        /*\n          toys => [\n            { name: \"Buzz Lightyear\", description: \"Space-ranger action figure who wears a space suit.\" },\n            { name: \"Woody\", description: \"Cowbody doll, Andy\'s favorite.\" },\n            { name: \"Jesse\", description: \"Cowgirl doll and part of the Woody\'s Round Up gang.\" }\n          ]\n        */\n      });\n\n      //add new toy record\n      let toy = { \n        name: \"Hamm\", \n        description: \"Wisecracking realist piggy bank.\", \n        voicedBy: \"John Ratzenberger\" \n      };\n\n      db.toys.addRecord(toy).then(function(newRecordId){\n        //newRecordId => 10001\n      });\n\n      //delete toy record\n      db.toys.delete(10001).then(function(deleted){\n        //deleted => true\n      });        \n\n      //import collection of toys\n      let toys = [\n        { name: \"Rex\", description: \"Excitable large, green, plastic Tyrannosaurus rex.\", voicedBy: \"Wallace Shawn\" },\n        { name: \"Slinky Dog\", description: \"Dachshund w/ slinky for body, speaks with a southern accent.\", voicedBy: \"Jim Varney\" },\n        { name: \"Mr. Potato Head\", description: \"Doll based on the real-life toy by Playskool.\", voicedBy: \"Don Rickles.\" },\n        { name: \"Bullseye\", description: \"Woody\'s horse that acts like a dog.\", voicedBy: \"\" },\n        { name: \"Bo Peep\", description: \"Porcelain figurine attached to Molly\'s bedside lamp.\", voicedBy: \"Annie Potts\" },\n      ];\n\n      db.toys.importFromCSV(toys).then(function(newRecordIds){\n        //newRecordIds => [10001, 10002, 10003, 10004, 10005]\n      });        \n    </code>\n  </pre></doc-section>");
$templateCache.put("docs/base-js/sections/settings.section.html","<doc-section><doc-header id=\"settings\">Settings</doc-header><doc-caption>Initialize your client using these settings in your configuration object.</doc-caption><p>When initializing a client, <b>base-js</b> takes an object of settings to help enhance its capabilities. Below are the object properties available:</p><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Value</th><th>Required</th></thead><tbody><tr><td>async</td><td>\'callback\' | \'promise\' | \'false\'</td><td>yes</td></tr><tr><td>apptoken</td><td>Application token string.</td><td>yes, if the application requires application tokens and no usertoken is supplied.</td></tr><tr><td>database id</td><td>QuickBase database ID</td><td>yes</td></tr><tr><td>tables</td><td>Object of table ids and field ids</td><td>yes</td></tr><tr><td>ticket</td><td>Valid authentication ticket.</td><td>no</td></tr><tr><td>username</td><td>Valid quickbase username.</td><td>no</td></tr><tr><td>password</td><td>Valid quickbase password.</td><td>no</td></tr><tr><td>usertoken</td><td>Valid API user token. This value takes precedence over username/password and ticket.</td><td>no</td></tr><tr><td>ticket</td><td>Valid authentication ticket.</td><td>no</td></tr><tr><td>realm</td><td>Quickbase realm.</td><td>no</td></tr></tbody></table><doc-header id=\"tables\" class=\"secondary\">Tables</doc-header><doc-caption>Control your tables with predefined table names, field names and id\'s.</doc-caption><p>The tables parameter is an important required setting. This parameter is an object of all the tables that will be used in your application. This includes the table name, table id\'s, field name and field id\'s.</p><pre>\n    <code class=\"language-javascript\">\n      const tables = {\n        toys: {\n          dbid: \"bjbsgxy3t\",\n          rid: 3,\n          name: 6,\n          type: 8,\n          description: 9,\n          voicedBy: 10,\n          primary: 11\n        },\n\n        locations: {\n          dbid: \"bjbsgxy83\",\n          rid: 3,\n          name: 6,\n          address: 7\n        }\n      };\n    </code>\n  </pre><doc-notice>Table names and field names can be named whatever you like. No need to match anything to QuickBase. These names will be used throughout the life of your project including the request and response data.</doc-notice><doc-header id=\"async-options\" class=\"secondary\">Async Options</doc-header><doc-caption>Promises, callbacks or synchronous http requests</doc-caption><p>When you execute something synchronously, you wait for it to finish before moving on to another task. When you execute something asynchronously, you can move on to another task before it finishes. Below are the different options available for the async setting parameter:</p><p>The \'promise\' and \'callback\' setting tell the library to make all HTTP requests asynchronously. \'false\' will execute all API requests synchronously.(not recommended)</p><table class=\"table bordered striped\"><thead><th>Value</th><th>Description</th></thead><tbody><tr><td>promise</td><td>All HTTP requests will be executed asynchronously and will return a promise.</td></tr><tr><td>callback</td><td>All HTTP requests will be executed asynchronously and a callback function will be executed once the request is complete.</td></tr><tr><td>false</td><td>All HTTP requests to QuickBase will be made synchronously.</td></tr></tbody></table><doc-best-practice>Using promises should be your #1 option. Callbacks #2. Synchronous is #3 but discourged and will most likely be deprecated in future versions.</doc-best-practice></doc-section>");
$templateCache.put("docs/code-snippets/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><doc-caption><p><b>code-snippets</b> is simple documentation for resuable code snippets or solutions. No rules, feel free to add any cool solutions, code snippets or QuickBase tricks.</p></doc-caption></doc-section>");
$templateCache.put("docs/code-snippets/sections/toggle-form-sections.section.html","<doc-section><doc-header id=\"toggle-form-sections\">toggle-form-sections</doc-header><doc-caption>Automatically expand & collapse QuickBase form sections with a native button.</doc-caption><img class=\"gif\" src=\"http://i.giphy.com/3oz8xC41Rxexow1YR2.gif\"><doc-header id=\"instructions\" class=\"secondary\">Instructions</doc-header><ol><li>Create a new \'Formula - Url\' button, set \'Link Text\' as \'Expand/Collapse Sections\' and add to top of form.</li><li>Paste the following in the new formula field and update the app dbid.<pre>\n        <code class=\"language-javascript\">\n  \"javascript:void($.getScript(\'\" & URLRoot() & \"db/INSERT_DBID_HERE?a=dbpage&pagename=toggle-form-sections.js\'))\"\n        </code>\n      </pre></li><li>Create a new code page, title it \'toggle-form-sections.js\' and copy the below code snippet.<pre>\n        <code class=\"language-javascript\">\n  var buttonTitle = \"Expand/Collapse Sections\";\n  var button = $($(\"a:contains(\'\"+buttonTitle+\"\')\")[0]);\n\n  var collapsedAttr = \"collapsed\";\n  var collapsed = $(button)[0].hasAttribute(collapsedAttr);\n\n  if(collapsed){\n    $(button).removeAttr(collapsedAttr)\n  }else{\n    $(button).attr(collapsedAttr, true);\n  };\n\n  $(\".sectionTitle\").each(function(index, ele){\n    var parent = $(ele).closest(\".sectionDiv\");\n\n    if(collapsed){\n      if($(parent).hasClass(\"expanded\")){\n        $(ele).trigger(\"click\");\n      };\n    }else{\n      if($(parent).hasClass(\"collapsed\")){\n        $(ele).trigger(\"click\");\n      };\n    };\n  });\n        </code>\n      </pre></li><li>Toggle.</li></ol><doc-notice>If you want your button to have a different title then \"Expand/Collapse Sections\" just update the first line of code in the snippet to match your new button title.</doc-notice></doc-section>");
$templateCache.put("docs/isomorph-js/sections/automated-webhooks.section.html","<doc-section><doc-header id=\"automated-webhooks\">Automated Webhooks</doc-header><p>Follow these steps to setup an automated webhook using Workato.</p><doc-header id=\"step-1\" class=\"secondary\">Step 1: Trigger</doc-header><ul><li>Login to Workato account using credentials in developer credentials document.</li><li>Click \"Create a new recipe\" in upper right hand corner.</li><li>Select \"Scheduler\" from \"Application\" dropdown.</li><li>Select \"New scheduled event\" from \"Trigger\" dropdown.</li><li>Select desired time interval option from \"Every\" dropdown.</li><li>Click \"Next\".</li></ul><doc-header id=\"step-2\" class=\"secondary\">Step 2: Actions</doc-header><ul><li>Select \"HTTP\" from \"Application\" dropdown.</li><li>Select \"POST\" from \"Method\" dropdown.</li><li>Insert the isomorph Endpoint URL in the \"Request URL\" input field.</li><li>Click \"Add/remove optional fields\" and select \"Request Header\" and \"Request Body\".</li><li>Insert the isomorph required params and content headers into the \"Request Headers\" input field. (see below)</li><li>Insert {} into the \"Request Body\" input field.</li><li>Click \"Next\".</li></ul><pre>\n    <code class=\"language-json\">\n      Request Headers:\n\n      Content-Type: application/json\n      Accept: application/json\n      realm: \n      dbid: \n      pageID:\n      user:\n\n      Request Body:\n      {}\n    </code>\n  </pre><doc-notice>Don\'t forget to add the \'Content-Type\' and \'Accept\' request headers.</doc-notice><doc-header id=\"step-3\" class=\"secondary\">Step 3: Connections</doc-header><ul><li>Click connection and select \"No Auth Header\" from existing connections dropdown.</li><li>Click \"Next\".</li></ul><doc-header id=\"step-4\" class=\"secondary\">Step 4: Description</doc-header><ul><li>Name your recipe using following naming convention: \"Automated Webhook - client name - webhook name\"</li><li>Select \"Private\" in \"Access\" dropdown.</li><li>Click \"Finish\"</li><li>Click arrow next to \"Test recipe\" and select \"Start Recipe\"</li><li>Done.</li></ul></doc-section>");
$templateCache.put("docs/isomorph-js/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\">Deployment</doc-header><p>Follow these four simple steps for setup and deployment.</p><ol><li>Write your JavaScript code in a QuickBase page.</li><li>Ensure <strong>system-user@advantagesoftware.net</strong> or <strong>quickstart@advantagequickbase.com</strong> has access to your application.</li><li>Fill out the proper configuration documented above.</li><li>Profit.</li></ol></doc-section>");
$templateCache.put("docs/isomorph-js/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><p><b>isomorph-js</b> is a tool that enables execution of client-side JavaScript code on the server.</p><p>Instead of having to endure a lengthy deployment and testing process for a simple script in Rails, <b>isomorph-js</b> gives you the option to keep all of your code in QuickBase.</p><p>The most common use case for <b>isomorph-js</b> at the time of this writing is for webhooks, but there are plans to develop a scheduling feature in the near future.</p></doc-section>");
$templateCache.put("docs/isomorph-js/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><p>The specifications listed below are for a typical webhook. A new hook can be created under the \"Webhooks\" section in QuickBase\'s table settings.</p><p><strong>Endpoint URL</strong>: <a href=\"https://d48pr0dwh3.execute-api.us-east-1.amazonaws.com/prod/LoadPage\">https://d48pr0dwh3.execute-api.us-east-1.amazonaws.com/prod/LoadPage</a></p><p><strong>HTTP method</strong>: POST</p><p><strong>Message format</strong>: JSON</p><p><strong>Message body</strong>: <em>This input takes a stringified object (JSON) that will be converted to GET parameters when making a request to your code page. See example:</em> <code class=\"language-javascript\">{\"notes\":\"This data was posted by a client side page via a webhook. Neat.\"}</code></p><p>In addition to the above, there are a number of <a href=\"#required-parameters\">required parameters</a> that you must pass as header values to the aforementioned endpoint. In QuickBase these are defined under the <strong>Message header</strong> section.</p><doc-warning><strong>isomorph-js</strong> uses PhantomJS to execute your code. Due to this, you may run into trouble with certain ES6 features such as classes, arrow functions and various iterators. Keep your code as vanilla as possible and it\'s unlikely you will have any problems.</doc-warning><doc-notice>If you are running asynchronous calls (promises, callbacks, deferreds) you must terminate the end of the chain by doing a <code class=\"language-javascript\">console.log(\"phantomjs:exit\");</code>. This ensures the PhantomJS process doesn\'t exit before the page has fully loaded.</doc-notice></doc-section>");
$templateCache.put("docs/isomorph-js/sections/required-parameters.section.html","<doc-section><doc-header id=\"required-parameters\">Required Parameters</doc-header><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Purpose</th></thead><tbody><tr><td>realm</td><td>QuickBase realm target code exists in.</td></tr><tr><td>dbid</td><td>Application ID of the app target code exists in.</td></tr><tr><td>appToken</td><td>Application token attributed to app, if required.</td></tr><tr><td>pageID</td><td>Page ID of the app target code exists in.</td></tr><tr><td>user</td><td>Two potential values: \"systemuser\" or \"quickstart\".<br>Your selection depends on which development user has access to the application specified above.</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/health-dashboard/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><p>AIS Solution Health Dashboard is a centralized application to monitor hosted web applications, services and background jobs.</p><h5>Live Health Updates</h5><p>All web applications hosted outside of QuickBase are automatically monitored every 5 minutes and record the health status of the application. Notifications are automatically sent if a web applications is down. A historical health trail will be kept to track application Uptime % overtime.</p><h5>Real-time Notifications</h5><p>Both Slack and email notifications are setup to automatically notify the associated team members if any issues have occured.</p><h5>Background Job Monitoring Tools</h5><p>All background jobs have a monitoring user interface that display all failed jobs, the jobs health status, scheduler information and the ability to manually execute or retry job.</p><h5>Developer Maintenance Server Checklist</h5><p>A detailed checklist performed routinely by the developer team to improve server maintenance consistency and practices.</p><h5>Maintenance Activity History</h5><p>A historical log of completed server maintenance and any actions taken on servers.</p></doc-section>");
$templateCache.put("docs/health-dashboard/sections/monitoring.section.html","<doc-section><doc-header id=\"monitoring\">Monitoring</doc-header><p>All web applications hosted outside of QuickBase are automatically checked every 5 minutes using a daemon script. Each check it records an \"Up\" or \"Down\" status</p></doc-section>");
$templateCache.put("docs/project-docs/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\">Deployment</doc-header><p>Commit and push all changes. Application is hosted on advantage\'s web server under \"/apps/project-docs\". Pull changes to application. Production pages are all static, no restart neccessary.</p></doc-section>");
$templateCache.put("docs/project-docs/sections/doc-style-guide.section.html","<doc-section><doc-header id=\"doc-style-guide\">Doc Style Guide</doc-header><p>All documentation is written in common HTML and SASS. No new markdown language or a long list of rules. Be sure to take advantage of the responsive CSS framework included(<a target=\"_blank\" href=\"http://materializecss.com/\">Materialize</a>).</p><doc-header id=\"style-guide\" class=\"secondary\">Organization Guide</doc-header><p>To create documentation that is consistent across projects and take advantage of new reusable components, below is a list of general rules to structure and organize your documentation.</p><table class=\"table bordered striped\"><thead></thead><tbody><tr><td>Sections</td><td>For each section of documentation, create a new section file in your sections project folder and include it in your index file. This will increase maintainability over time and keep files short and sweet. Wrap all data in section with a \'doc-section\' component tag.</td></tr><tr><td>Headers</td><td>Use clear and concise header names. Headers automatically render in the side-navigation so they must be simple and make their purpose obvious. Wrap headers with a \'doc-header\' component tag so they are automatically loaded in the side-nav.</td></tr><tr><td>Misc Content</td><td>Store content in \'p\' tags.</td></tr><tr><td>Collections</td><td>Use tables to store collections. Use the \'table\' tag and include the \'table\', \'striped\', \'bordered\' classes provided by Materialize.</td></tr><tr><td>Notices</td><td>Use notices when you need to draw attention to important information. Use the \'doc-notice\', \'doc-warning\', or \'doc-best-practice\' component tags.</td></tr><tr><td>Code Examples</td><td>Include simple and direct code examples whenever possible. Use the \'code\' tag wrapped with a \'pre\' tag to display syntax highlighted code. The syntax will try to be automatically detected but to set the language explicitly include the class such as \'language-javascript\', \'language-html\' or \'language-css\'. <a href=\"http://prismjs.com/#languages-list\" target=\"_blank\">here</a> is a list of all supported languages</td></tr></tbody></table><doc-header id=\"components\" class=\"secondary\">Components</doc-header><p>Utilize these components to reuse common elements of documentation:</p><table class=\"table bordered striped\"><thead></thead><tbody><tr><td>doc-section</td><td>Use to separate sections of documentation.</td></tr><tr><td>doc-header</td><td>Use to add new header to the side-nav and create the anchor.</td></tr><tr><td>doc-caption</td><td>Pair with doc-header to create caption under header.</td></tr><tr><td>doc-notice</td><td>Use to build notice on page.</td></tr><tr><td>doc-warning</td><td>Use to build warning on page.</td></tr><tr><td>doc-best-practice</td><td>Use to build best-practive notice on page.</td></tr><tr><td>doc-command</td><td>Use to display command line instructions.</td></tr></tbody></table><doc-notice>These tags are optional. You can use any HTML tag you wish but these components pack a punch.</doc-notice><doc-header id=\"classes\" class=\"secondary\" it=\"has\">Classes</doc-header><p>These classes apply common styling or bind functionality to your elements as usual.</p><p></p><table class=\"table bordered striped\"><tbody><tr><td>secondary</td><td>Add this class to \'doc-header\' to have header display as a subheader in the navigation pane.</td></tr><tr><td>table</td><td>Add common styling to a table</td></tr><tr><td>striped</td><td>Add row striping to your table</td></tr><tr><td>bordered</td><td>Add borders to your table</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/project-docs/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><doc-caption><p><b>project-docs</b> is a platform to develop and store documentation for common libraries, projects and tools.</p></doc-caption><p><b>project-docs</b> provides a standard UI to improve ease of use and readability, reusable components to shorten the documentation process and help construct documentation standards.</p><p>All documentation is written in common HTML & SASS, no new rules or markdown to learn.</p><p>Functionality includes reusable components, responsive CSS framework, automatic side-navigation/routing and syntax highlighted code examples.</p><p>Inspired by other more robust documentation UI\'s:</p><ul><li><a href=\"https://stripe.com/docs/api#intro\" target=\"_blank\">Stripe API</a></li><li><a href=\"https://angular.io/docs/ts/latest/\" target=\"_blank\">AngularJS</a></li><li><a href=\"http://underscorejs.org/\" target=\"_blank\">Underscore</a></li></ul>All project documentation can be found at <a href=\"http://docs.advantagequickstart.com/\" target=\"_blank\">http://docs.advantagequickstart.com/</a></doc-section>");
$templateCache.put("docs/project-docs/sections/new-project.section.html","<doc-section><doc-header id=\"new-project\">Document New Project</doc-header><doc-caption>Nothing new to learn. The folder organization will do most of the work.</doc-caption><p>All documentation is stored within the <a href=\"https://github.com/KitHensel/project-docs\" target=\"_blank\">project-docs</a> Angular QuickStart application.</p><p>Each documented project has its own folder under the \"/docs\" folder making it clear and easy-to-organize and find documentation. Inside each folder is an index.doc.html file and a \'sections\' folder.</p><p>Once your folder structure is setup, everything else is automatic including the routing, side-navigation, and making your project visible to the team on the dashboard.</p><doc-header id=\"instructions\" class=\"secondary\">Instructions</doc-header><ol><li>Download the <a href=\"https://github.com/KitHensel/project-docs\" target=\"_blank\">project-docs</a> application and run npm install.</li><li>Run the below project gulp task. The documentation boilerplate will automatically be generated under \"/docs/(name-of-project)\".<br><h5>gulp project --name name-of-project</h5></li><li>Add the project name, a short description and status to the \"/docs/index.js\" file. Status should be set to either (current | in progress | not started)</li><li>Document and review locally using \"gulp local\".</li><li>When complete, commit & pull to the project-docs application at \"/apps/project-docs\" located on the web-server.</li></ol><doc-notice>The name used to title your project in the gulp task will also be the route where you can find your documentation. \'<b>localhost:3000/name-of-project</b>\' or \'<b>docs.advantagequickstart.com/name-of-project</b>\'</doc-notice><doc-warning>Ensure the project folder matches the project name in the \"/docs/index.js\" configuration file.</doc-warning></doc-section>");
$templateCache.put("docs/project-docs/sections/side-navigation.section.html","<doc-section><doc-header id=\"side-navigation\">Side-Navigation</doc-header><doc-caption>The side-navigation is automatically rendered.</doc-caption><p>To add a header to the side-navigation, add a <b>\'doc-header\'</b> tag to your document. The side-navigation will be rendered in the order the headers appear in your document. Adding the class, \"secondary\", will make the header display as a sub-header under the closest primary doc header.</p><doc-notice>Ensure to add an \'id\' attr to your headers and subheaders to create an anchor.</doc-notice><doc-warning>Place the headers and subheaders in order. It doesn\'t make sense to put a subheader before a header or have a subheader without a header.</doc-warning></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/app-structure.section.html","<doc-section><doc-header id=\"app-structure\">App Structure</doc-header><p>This section briefly introduces the structure of <b>quickstart-angular</b>.</p><table class=\"table striped bordered\"><thead><th>Folder</th><th>Purpose</th></thead><tbody><tr><td>app</td><td>src code related to the actual web app solution. Includes controllers, directives, components, layouts, styles.</td></tr><tr><td>build</td><td>build-gulp tasks for your environment.</td></tr><tr><td>config</td><td>project & application configuration</td></tr><tr><td>dist</td><td>minified/compiled/ready-for-production version of your src code</td></tr><tr><td>node_modules</td><td>node-module dependencies for environment</td></tr><tr><td>tmp</td><td>compiled version of code for local development</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/conceptual-overview.section.html","<doc-section><doc-header id=\"conceptual-overview\">Conceptual Overview</doc-header><p>This section briefly touches on all of the important parts of <b>quickstart-angular</b>.</p><doc-header id=\"angular-js\" class=\"secondary\">AngularJS</doc-header><p>AngularJS is the heart and soul of <b>quickstart-angular</b>. If you are comfortable with AngularJS, much of this framework will be familiar. This framework serves as a vehicle to utilize and organize the many core features of AngularJS. A great start to understanding each aspect of this application is to dive right into the AngularJS v1.5 <a href=\"https://docs.angularjs.org/guide\" target=\"_blank\">docs</a>.</p><p>AngularJS is ideal fit for building single-page applications for cloud-platforms like QuickBase and ServiceNow. Due to the advancements in web-development and JavaScript, most modern solutions no longer need a complicated, (million-moving-parts) server-side setup that requires support, uptime and routine maintainance. With these single-page applications we can focus on the customer and the development and let to the cloud-platform worry about everything else.</p><doc-header id=\"components\" class=\"secondary\">Components</doc-header><p>Many frameworks are beginning to be built around the concept of components. <b>quickstart-angular</b> utilizes AngularJS components and is architectured to support a much more object-oriented/component driven platform. Since we are ensuring our code is organized correctly, we can begin developing and importing commonly used <a href=\"https://github.com/AdvantageIntegratedSolutions/qsm\" target=\"_blank\">angular modules</a>. <b>quickstart-angular</b> was built with Angular2 in mind. Here is a quick segue <a href=\"https://toddmotto.com/exploring-the-angular-1-5-component-method/\" target=\"_blank\">article</a> on components() vs directives().</p><doc-header id=\"template-cache\" class=\"secondary\">Template Cache</doc-header><doc-caption>Template cache is awesome.</doc-caption><p>So how do we build a single-page application when we have multiple pages/templates/partials needed witin our app? By using the angular\'s $templateCache service. All html files in the /app folder are automatically registered in angular\'s <a href=\"https://docs.angularjs.org/api/ng/service/$templateCache\" target=\"_blank\">$templateCache</a>. Once the files are registered, we can include the page/template/partial path in any of our directives and components.</p><doc-header id=\"base-js\" class=\"secondary\">base.js</doc-header><p><a href=\"https://github.com/AdvantageIntegratedSolutions/base-js\">base.js</a> is a Javascript library built for the QuickBase API. base-js includes functions for almost all QuickBase API calls. It provides common helper functions, query selectors and finder methods. Everything is JSON instead of QuickBase\'s default XML. Promises and callbacks are both supported.</p><doc-header id=\"gulp\" class=\"secondary\">gulp</doc-header><p><a href=\"https://github.com/gulpjs/gulp\" target=\"_blank\">gulp</a> is a toolkit that helps you automate painful or time-consuming tasks in your development workflow. That is exactly what it is doing in <b>quickstart-angular</b>, doing alot of tasks that we would otherwise have to do manually. These tasks include but are not limited to: compiling and minifying source code, launching development server, automatically updating browser on change, caching templates and deploying.</p><p>The mechanisms of gulp could be considered complicated however the library of <a href=\"http://gulpjs.com/plugins/\" target=\"_blank\">plugins</a> built by the community make it very powerful and easy to configure.</p></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\">Deployment</doc-header><doc-caption>Deploying your application to the web</doc-caption><p>When you are ready to deploy your application, you can deploy your application straight from your console. <b>quickstart-angular</b> currently only supports automated deployment to a QuickBase application. If you need to deploy to a different platform, you can manually copy the auto-compiled files in your /tmp folder.</p><p>To deploy your application, shut down your local server and run:</p><doc-command>gulp deploy</doc-command><p>Running \'gulp deploy\' will ensure all of your source-code is recompiled, minified, paths are resolved and files are uploaded to QuickBase. Your distribution code will be stored in the /dist folder and each file will be prefixed with the name of your application configured in /config/app.config.js.</p><doc-warning>If pages in QuickBase already exist within the QuickBase application and your /dist filenames match the existing pagenames, the existing QuickBase pages will be overwritten.</doc-warning></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/gulp-tasks.section.html","<doc-section><doc-header id=\"gulp-tasks\">gulp Tasks</doc-header><doc-caption>Automated tedious tasks.</doc-caption><p>gulp is responsible for all of the automation within <b>quickstart-angular</b>. You can safety assume that any actions taken to your project are somehow related to gulp. All gulp tasks are loaded in our gulpfile.js at the root of the project. All tasks are located in our /build folder.</p><doc-header id=\"list-of-tasks\" class=\"secondary\">List of tasks</doc-header><table class=\"table striped bordered\"><thead><th>Task</th><th>Purpose</th></thead><tbody><tr><td>local</td><td>launches local server at localhost:3000</td></tr><tr><td>deploy</td><td>deploy all application source code to QuickBase</td></tr><tr><td>js-dev</td><td>run all javascript tasks required for development</td></tr><tr><td>js-prod</td><td>run all javascript tasks required for production</td></tr><tr><td>css-dev</td><td>run all css tasks required for development</td></tr><tr><td>css-prod</td><td>run all css tasks required for production</td></tr><tr><td>html-dev</td><td>run all html tasks required for development</td></tr><tr><td>html-prod</td><td>run all html tasks required for production</td></tr><tr><td>upload-html</td><td>upload dist index html to QuickBase application</td></tr><tr><td>upload-assets</td><td>upload dist assets to QuickBase application</td></tr><tr><td>templates</td><td>load all html files into template cache</td></tr><tr><td>init</td><td>clear and populate readme</td></tr></tbody></table><doc-notice>Any of these tasks can be run individually by running \'gulp task-name\' within your command line however the majority of these are automatically bundled into the tasks \'local\' or \'deploy\'.</doc-notice></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><p><b>quickstart-angular</b> is an angular web-framework to build consistent, quality QuickBase and ServiceNow single-page applications.</p><p>quickstart-angular allows developers to fire up single-page application within minutes. Reusable angular modules can be quickly imported from a <a href=\"https://github.com/AdvantageIntegratedSolutions/qsm\" target=\"_blank\">centralized angular module library</a>.</p><p>It allows developers to spend less time setting up a suitable environment and more time developing client solutions. The framework includes a intuitive local development environment, a consistent directory structure across projects and common helper tasks to compile, serve and deploy your project.</p></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/local-environment.section.html","<doc-section><doc-header id=\"local-environment\">Local Environment</doc-header><doc-caption>Perform all of your development locally.</doc-caption><p>All development and testing can be done locally by launching a local server. Due to cross-origin restrictions all QuickBase API requests will be made through a AWS lambda proxy. This is all done automatically when building within <b>quickstart-angular</b>.</p>To launch your local server run the below command at the root of your project:<doc-command>gulp local</doc-command><p>Once your local server has successfully launched, a tab should automatically open in your default browser at localhost:3000.</p><p>Now that we are up and running, any saved changes to any of your application code will automatically trigger a refresh of your browser window.</p><doc-notice>Any syntax errors will be caught and will not crash your server. If something isn\'t refreshing correctly, ensure to revisit your terminal to track any logged errors.</doc-notice></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><doc-caption>Starting a new project.</doc-caption><p>Once your environment is all setup, starting a new project is easy. The <b>quickstart-angular</b> framework is hosted on GitHub and no external dependencies are required. This is ideal, because we will clone this repo, quickly adapt to our new project and hit the ground running.</p><h5>Step-by-step instructions:</h5><ol><li>Create new repo on Github and title the repo to the name of your project.</li><li>Clone the <b><a href=\"https://github.com/AdvantageIntegratedSolutions/quickstart-angular.git\" target=\"_blank\">quickstart-angular</a></b> repo and provide the name of your new project.<doc-command>git clone https://github.com/AdvantageIntegratedSolutions/quickstart-angular.git new-app-name</doc-command></li><li>Update the git origin remote with your app\'s repo url.<doc-command>git remote set-url origin new-repo-git-url</doc-command></li><li>Install node modules at the root of your new project folder.<doc-command>npm install</doc-command></li><li>Configure the \'config/app.config.js\' file to your new project.</li><li>Start your local server on \'localhost:3000\'.<doc-command>gulp local</doc-command></li><li>You are all setup. Visit \'localhost:3000\' to view your project.</li></ol></doc-section>");
$templateCache.put("docs/quickstart-angular/sections/setup.section.html","<doc-section><doc-header id=\"setup\">Setup</doc-header><doc-caption>Ensure your environment is ready to start a project.</doc-caption><p>If this is not your first quickstart-angular project, you can most likely bypass this section. If this is your 1st project, let\'s get your environment setup!</p><doc-header id=\"dependencies\" class=\"secondary\">Dependencies</doc-header><doc-caption>Make sure you have the following successfully installed.</doc-caption><table class=\"table striped bordered\"><thead></thead><thead><th>Dependency</th><th>Source</th><th>Check if its installed</th></thead><tbody><tr><td>Node ^5.5.0</td><td><a href=\"https://nodejs.org/en/download/package-manager/\" target=\"_blank\">node</a></td><td>node -v</td></tr><tr><td>npm</td><td><a href=\"https://docs.npmjs.com/getting-started/installing-node\" target=\"_blank\">npm</a></td><td>npm -v</td></tr><tr><td>git</td><td><a href=\"https://git-scm.com/book/en/v2/Getting-Started-Installing-Git\" target=\"_blank\">git</a></td><td>git --version</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/server-checklist/sections/app-monitoring.section.html","<doc-section><doc-header id=\"step-1\">Step 1: App Monitoring</doc-header><doc-caption>Ensure all hosted web applications are up-and-running.</doc-caption><p>For any web application that is not hosted in QuickBase, Advantage is responsilbe for hosting and maintaining these solutions. Advantage hosts all web applications on several dedicated AWS instances.</p><p>The majority of web applications are hosted at <b>ubuntu@ec2-54-158-153-66.compute-1.amazonaws.com</b> under the /apps folder. Web server configuration is always located at <b>/opt/nginx/conf/nginx.conf</b>.</p><doc-task>Review all applications using the AIS Solution Health Dashboard.</doc-task><doc-task>Ensure the upDown script is logging recent activity.</doc-task><a class=\"waves-effect waves-light btn blue darken-3\" href=\"https://ais.quickbase.com/db/bk2cqgcb7\" target=\"_blank\">Review Health Dashboard</a></doc-section>");
$templateCache.put("docs/server-checklist/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><p><b>server-checklist</b> is a detailed checklist that is routinely executed by the developer team to maintain and monitor servers, solutions and products. The checklist is estimated to take less than 20 minutes if no actionable items are found. Many potential common issues can be mitigated by routine oversight.</p><p>This checklist is not a replacement or a catch all solution and is paired with other monitoring tools and processes.</p><p>Recommended that this checklist is performed 1-2 times per week, preferably later in the day or early morning.</p></doc-section>");
$templateCache.put("docs/server-checklist/sections/job-monitoring.section.html","<doc-section><doc-header id=\"step-2\">Step 2: Job Monitoring</doc-header><doc-caption>Ensure schedulers and queues are active.</doc-caption><p>All background jobs are managed and triggered <a href=\"https://github.com/resque/resque\" target=\"_blank\">Resque</a> workers and schedulers. Resque provides a Monitoring User Interface to monitor workers, active jobs and failed jobs. We can also retry or manually kick off jobs from the Monitoring User Interface. Notifications can be setup but are currently turned off.</p><doc-task>Review the below Resque monitoring interfaces and ensure all workers are active.</doc-task><doc-task>Review all failed jobs and take any neccessary actions.</doc-task><doc-task>Clear failed jobs that have been addressed or are unimportant.</doc-task><doc-task>Log-on to servers and ensure that the \'scheduler\' processes are alive. \'ps -Aef | grep scheduler\'</doc-task><table class=\"table striped bordered\"><thead><th>App</th><th>Resque Monitoring Tool</th><th>Server</th></thead><tbody><tr><td><a href=\"https://github.com/AdvantageIntegratedSolutions/AdvantageApps\" target=\"_blank\">AdvantageApps(v1)</a></td><td><a href=\"https://link.advantagesoftware.net/resque/overview\" target=\"_blank\">Resque</a></td><td>ubuntu@54.235.255.133</td></tr><tr><td><a href=\"https://github.com/AdvantageIntegratedSolutions/BackgroundJobs\" target=\"_blank\">BackgroundJobs(v2)</a></td><td>Resque is not implemented for this app. Must review log files manually.</td><td>ubuntu@54.235.255.133</td></tr><tr><td><a href=\"https://github.com/AdvantageIntegratedSolutions/MailLink\" target=\"_blank\">MailLink</a></td><td><a href=\"https://maillink.advantagesoftware.net/resque/overview\" target=\"_blank\">Resque</a></td><td>ubuntu@174.129.242.165</td></tr><tr><td><a href=\"https://github.com/AdvantageIntegratedSolutions/AccountManager\" target=\"_blank\">AccountManager</a></td><td><a href=\"https://accountmanager.advantagesoftware.net/resque/overview\" target=\"_blank\">Resque</a></td><td>ubuntu@ec2-54-89-161-237.compute-1.amazonaws.com</td></tr><tr><td><a href=\"https://github.com/AdvantageIntegratedSolutions/ACube\" target=\"_blank\">VMWare ACube</a></td><td><a href=\"https://acube.advantagesoftware.net/resque/overview\" target=\"_blank\">Resque</a></td><td>ubuntu@ec2-54-89-197-154.compute-1.amazonaws.com</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/server-checklist/sections/memory.section.html","<doc-section><doc-header id=\"step-3\">Step 3: Memory</doc-header><p>Memory-management is exactly what it sounds like. Many issues can arise if the server is out of RAM or disk space.</p><doc-task>Log-on to each server below and review memory usage. Take any neccessary actions.</doc-task><doc-task>Clear larger log files(cp /dev/null filename). Only delete log files if they are no longer active.</doc-task><table class=\"table striped borderd\"><thead><th>Server Name</th><th>IP</th></thead><tbody><tr><td>Web Server</td><td>ubuntu@server_web.advantagesoftware.net</td></tr><tr><td>Database Server</td><td>ubuntu@server_database.advantagesoftware.net</td></tr><tr><td>Client Processing Server</td><td>ubuntu@server_client_processing.advantagesoftware.net</td></tr><tr><td>ResCare Processing Server</td><td>ubuntu@server_rescare_processing.advantagesoftware.net</td></tr><tr><td>Products Server</td><td>ubuntu@server_products.advantagesoftware.net</td></tr><tr><td>ACube Scripting</td><td>ubuntu@ec2-54-89-197-154.compute-1.amazonaws.com</td></tr><tr><td>Application Server</td><td>ubuntu@ec2-54-82-121-255.compute-1.amazonaws.com</td></tr><tr><td>Account Management Tool Server</td><td>ubuntu@ec2-54-89-161-237.compute-1.amazonaws.com</td></tr><tr><td>Howard Alan Events - Credit Card App</td><td>server_howard_alan.advantagesoftware.net</td></tr></tbody></table><doc-notice>sudo find . -type f -size +3M -name *log* will find all log files over 3M.</doc-notice><doc-notice>If you are comfortable using AWS, login to the EC2 Management Console using the AWS credentials to read the server info directly.</doc-notice></doc-section>");
$templateCache.put("docs/server-checklist/sections/review.section.html","<doc-section><doc-header id=\"step-5\">Step 5: Review</doc-header><doc-task>Ensure to communicate any issues as soon as possible with the developer team, any solution-consultants that may be affected and/or clients.</doc-task><doc-task>Log your activity into the AIS Solution Health Dashboard so we can track who/when any server maintenance has occurred.</doc-task><a class=\"waves-effect waves-light btn blue darken-3\" href=\"https://ais.quickbase.com/db/bk2cqnsp7?a=nwr\" target=\"_blank\">Add Maintenance Log</a></doc-section>");
$templateCache.put("docs/server-checklist/sections/security.section.html","<doc-section><doc-header id=\"step-4\">Step 4: Security</doc-header><p>Security management is complicated but some high-level maintainance can make a world of difference and keep our servers secure and safe.</p><doc-task>When logging onto server, the server will tell you if you have any packages and security updates to install. run \'sudo apt-get update\' if neccessary.</doc-task><doc-task>Navigate to the commonly used areas of the servers and ensure no folders are open to the world with write or execute permissions.</doc-task><doc-task>Check active connections and look for suspicious IP addressses from places like China or Russia. \'netstat -natp\'</doc-task></doc-section>");
