$templateCache.put("docs/pdf-link/sections/format-parameters.section.html","<doc-section><doc-header id=\"format-parameters\">Format Parameters</doc-header><p>Additional parameters can be used to format and configure the setings of the pdf. The majority if not all the parameters found on <a href=\"https://www.html2pdfrocket.com/\" target=\"_blank\">html2pdfrocket</a> are supported.</p><table class=\"table striped bordered\"><thead><th>Parameters</th><th>Purpose</th></thead><tbody><tr><td>MarginLeft</td><td>Value of left margin - default is 0</td></tr><tr><td>MarginRight</td><td>Value of right margin - default is 0</td></tr><tr><td>MarginTop</td><td>Value of top margin - default is 0</td></tr><tr><td>MarginBottom</td><td>Value of bottom margin - default is 0</td></tr><tr><td>UseGrayscale</td><td>true to generate PDF in grayscale, false or leave blank for full colour</td></tr><tr><td>UseLandscape</td><td>true to rotate page to landscape, false or leave blank for portrait</td></tr><tr><td>EnableForms</td><td>true to turn html form fields into pdf form fields</td></tr><tr><td>LowQuality</td><td>true to reduce the quality, which may lower your network usage if quality is still satisfactory</td></tr><tr><td>DisableShrinking</td><td>true to disable the intelligent shrinking process we use make the pixel/dpi ratio constant</td></tr><tr><td>DisableJavascript</td><td>true to disable running JS on page, otherwise javascript runs</td></tr><tr><td>JavascriptDelay</td><td>Milliseconds to wait for JS to finish executing before converting the page. Useful for ajax calls.</td></tr><tr><td>UsePrintStylesheet</td><td>true to use the print media stylesheet, false or leave blank to use normal stylesheet</td></tr><tr><td>FooterSpacing</td><td>Spacing between the header and the content in mm - default is 0</td></tr><tr><td>HeaderSpacing</td><td>Spacing between the footer and the content in mm - default is 0</td></tr><tr><td>PageSize</td><td>Default size is A4 but you can use Letter, A0, A2, A3, A5, Legal, etc.</td></tr><tr><td>PageWidth</td><td>Page width - if you use this, you must also use PageHeight</td></tr><tr><td>PageHeight</td><td>Page Height - if you use this, you must also use PageHeight</td></tr><tr><td>ViewPort</td><td>e.g. 800x600 - Set if you have custom scrollbars or css attribute overflow to emulate window size</td></tr><tr><td>Dpi</td><td>Explicitly set the DPI, which is 96 by default. Also see Zoom settings</td></tr><tr><td>Zoom</td><td>Default zoom is 1.00 You can use any floating point number, e.g. 0.5, 0.75, 1.10, 2.55, 3...</td></tr><tr><td>OutputFormat</td><td>Must be either \"pdf\", \"jpg\", \"png\", \"bmp\" or \"svg\" if not supplied the default is PDF</td></tr><tr><td>Username</td><td>For URL conversions, creates a secure basic authentication connection to your server</td></tr><tr><td>Password</td><td>For URL conversions, creates a secure basic authentication connection to your server</td></tr><tr><td>Cookie</td><td>Supply in format: NAME|||VALUE|||NAME|||VALUE (that\'s 2 cookies). Often used for authentication.</td></tr><tr><td>HeaderUrl</td><td>To use an html header on each page - a url starting with http containing the html</td></tr><tr><td>FooterUrl</td><td>To use an html footer on each page - a url starting with http containing the html</td></tr><tr><td>HeaderLeft</td><td>Top left header text (can use replacement tags below)</td></tr><tr><td>HeaderRight</td><td>Top right header text (can use replacement tags below)</td></tr><tr><td>FooterLeft</td><td>Bottom left footer (can use replacement tags below)</td></tr><tr><td>FooterRight</td><td>Bottom right footer (can use replacement tags below)</td></tr><tr><td>FooterFontName</td><td>Footer font names - Arial by default</td></tr><tr><td>HeaderFontName</td><td>Header font names - Arial by default</td></tr><tr><td>FooterFontSize</td><td>The font sizes - 12 by default. Use the the plain value (do not use px or pt)</td></tr><tr><td>HeaderFontSize</td><td>The font sizes - 12 by default. Use the the plain value (do not use px or pt)</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/pdf-link/sections/headers-footers.section.html","<doc-section><doc-header id=\"headers-footers\">Headers and Footers</doc-header><p>Headers and footers can be configured using the above format parameters. Simple values such as page numbers or date stamps can be easily passed across in the url and the converter will auto-include on these values on every page.</p><doc-header id=\"complex-header-footer\" class=\"secondary\">Complex Headers/Footers</doc-header><p>Often times you may need to have headers and footers that are repeated on every page but are much more complex than simple page numbers or a datestamp. To accomplish this you can utilize the \'HeaderUrl\' and \'FooterUrl\' parameters.</p><p>You can pass in an additional encoded url to have the entire content of a page be embedded as a header or footer.</p><pre>\n	<code class=\"language-javascript\">\n	//required parameters\n	const url = encodeURIComponent(\"https://www.google.com\");\n	const filename = \"invoice-10001\"\n\n	//parameters to set header/footer with html content\n	const headerUrl = encodeURIComponent(\"https://ais.quickbase.com/header.html\")\n	const footerUrl = encodeURIComponent(\"https://ais.quickbase.com/footer.html\")\n\n	const parameters = \n		\"&url=\" + url + \n		\"&FileName=\" + filename + \n		\"&headerUrl=\" + headerUrl + \n		\"&footerUrl\" + footerUrl \n\n	const pdfUrl = \"https://pdflink.advantagesoftware.net/convert/new?rocket=true\" + parameters;\n\n	$.get(pdfUrl);\n	</code>\n</pre><doc-warning>Do not attempt to use CSS page-break properties or javascript algorithms to solve the fixed repeated footer on every page problem. Many have tried, many have failed.</doc-warning></doc-section>");
$templateCache.put("docs/pdf-link/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><p><b>pdf-link</b> is a tool to generate and/or store PDF\'s. PDF\'s are generated by converting HTML/JavaScript pages.</p><p><b>pdf-link</b> utilizes a third-party PDF converter called <a href=\"https://www.html2pdfrocket.com/\" target=\"_blank\">html2pdfrocket</a> to convert HTML pages to PDF documents. These generated pdf documents can be downloaded or saved back to QuickBase. This tool is entirely configured using URL query parameters.</p><p><b>pdf-link</b> is a simple rails application hosted on the Advantage web server that can be pinged from anywhere. It is offered to our clients at $1,188 a year for unlimited pdf conversions.</p><p>The endpoint for <b>pdf-link</b> is <a href=\"https://pdflink.advantagesoftware.net/convert/new?\" target=\"_blank\">https://pdflink.advantagesoftware.net/convert/new</a></p></doc-section>");
$templateCache.put("docs/pdf-link/sections/pricing.section.html","<doc-section><doc-header id=\"pricing\">Pricing</doc-header><p><b>pdf-link</b> is $1,188/year for unlimted PDF conversions.</p></doc-section>");
$templateCache.put("docs/pdf-link/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><doc-caption>Let\'s convert a simple HTML page.</doc-caption><p>To convert an HTML page to a PDF, we will do a simple GET on our <b>pdf-link</b> endpoint while passing all neccessary query parameters.</p><p>Try opening the following url into your browser to see a simple example in action.</p><a target=\"_blank\" href=\"https://pdflink.advantagesoftware.net/convert/new?FileName=advantage&url=http%3A%2F%2Fwww.advantagequickbase.com%2F&rocket=true&serve=true\">https://pdflink.advantagesoftware.net/convert/new?FileName=timecard&url=http%3A%2F%2Fwww.advantagequickbase.com%2F&rocket=true&serve=true</a><p>Notice we are only passing a the minimum required url parameters to our pdf-link endpoint. Additional functionality can be utilized using other query parameters documented below.</p></doc-section>");
$templateCache.put("docs/pdf-link/sections/required-parameters.section.html","<doc-section><doc-header id=\"required-parameters\">Required Parameters</doc-header><p>The following parameters are required for converting an HTML page to PDF.</p><table class=\"table striped bordered\"><thead><th>Required Parameters</th><th>Purpose</th></thead><tbody><tr><td>url</td><td>Url of HTML page being converted. Must be url <a href=\"http://meyerweb.com/eric/tools/dencoder/\" target=\"_blank\">encoded</a>.</td></tr><tr><td>rocket</td><td>Must be set to true. Tells pdf-link to use newer pdf converting service.</td></tr><tr><td>FileName</td><td>Name of desired output file. Exclude file extension.</td></tr></tbody></table><pre>\n	<code class=\"language-javascript\">\n	const url = encodeURIComponent(\"https://www.google.com\");\n	const filename = \"invoice-10001\"\n\n	const pdfUrl = \"https://pdflink.advantagesoftware.net/convert/new?rocket=true&\" + \"url=\" + url + \"&FileName=\" + filename;\n\n	$.get(pdfUrl);\n	</code>\n</pre><doc-warning>The \'rocket\' parameter forces pdf-link to use html2pdfrocket intead of ConvertAPI. Convert API is a previous third-party service that had issues splitting tables and hard to reach support.</doc-warning><doc-notice>Always remember your first url query parameter will follow a \'?\' not a \'&\'.</doc-notice></doc-section>");
$templateCache.put("docs/pdf-link/sections/saving-pdf.section.html","<doc-section><doc-header id=\"saving-pdf\">Saving PDF</doc-header><doc-caption>Save the pdf back to QuickBase</doc-caption><p>Many times you may need to convert a QuickBase page and save the PDF back to QuickBase.</p><p>Let\'s say you have a button on a customer form titled \"Generate Invoice\". The user could click this button, generate an invoice by converting an invoice custom page to a PDF and then save this new invoice pdf back to the customer record.</p><p>There are three options to save a PDF:</p><ul><li>Attach the PDF to an existing record in a file attachment field in QuickBase.</li><li>Create a child record and relate to a parent record in QuickBase.</li><li>Download the PDF to local clients computer.</li></ul><p>Each use case uses different url parameters. Below are the different required parameters to save a pdf to QuickBase.</p><doc-header id=\"attach-to-record\" class=\"secondary\">Attach to record</doc-header><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Value</th></thead><tbody><tr><td>domain</td><td>quickbase domain of application</td></tr><tr><td>app_token</td><td>application\'s app token, required if enabled in application</td></tr><tr><td>dbid</td><td>dbid of table that contains record</td></tr><tr><td>rid</td><td>record id</td></tr><tr><td>file_fid</td><td>field id of file attachment field</td></tr></tbody></table><pre>\n	<code class=\"language-javascript\">\n	//required parameters\n	const url = encodeURIComponent(\"https://www.google.com\");\n	const filename = \"invoice-10001\"\n\n	//parameters to save pdf to record\n	const domain = \"ais\"\n	const dbid = \"bfghighi\";\n	const rid = 10001;\n	const file_fid = 10;\n\n	const parameters = \n		\"&url=\" + url + \n		\"&FileName=\" + filename + \n		\"&domain=\" + domain + \n		\"&dbid\" + dbid + \n		\"&rid\" + rid + \n		\"&file_fid\" + file_fid;\n\n	const pdfUrl = \"https://pdflink.advantagesoftware.net/convert/new?rocket=true\" + parameters;\n\n	$.get(pdfUrl);\n	</code>\n</pre><doc-header id=\"create-new-record\" class=\"secondary\">Create new record</doc-header><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Value</th></thead><tbody><tr><td>domain</td><td>quickbase domain of application</td></tr><tr><td>app_token</td><td>application\'s app token, required if enabled in application</td></tr><tr><td>rid</td><td>record id of parent record</td></tr><tr><td>parent_fid</td><td>field id of parent reference field</td></tr><tr><td>child_dbid</td><td>dbid of table where new record will be saved with pdf</td></tr><tr><td>file_fid</td><td>field id of file attachment field in child table</td></tr></tbody></table><pre>\n	<code class=\"language-javascript\">\n	//required parameters\n	const url = encodeURIComponent(\"https://www.google.com\");\n	const filename = \"invoice-10001\"\n\n	//parameters to save pdf to record\n	const domain = \"ais\"\n	const rid = 10001;\n	const parent_fid = 6;\n	const child_dbid = \"bfghiag3\"\n	const file_fid = 10;\n\n	const parameters = \n		\"&url=\" + url + \n		\"&FileName=\" + filename + \n		\"&domain=\" + domain + \n		\"&rid\" + rid + \n		\"&parent_fid\" + parent_fid +\n		\"&child_dbid\" + child_dbid + \n		\"&file_fid\" + file_fid;\n\n	const pdfUrl = \"https://pdflink.advantagesoftware.net/convert/new?rocket=true\" + parameters;\n\n	$.get(pdfUrl);\n	</code>\n</pre><doc-header id=\"download\" class=\"secondary\">Download</doc-header><p>If you only want to download the pdf, ignore the above parameters and just include the required and optional format parameters.</p></doc-section>");
